import { BottomNavigation } from "@material-ui/core";
import React from "react";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import { Doughnut } from "react-chartjs-2";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPaperPlane } from "@fortawesome/free-solid-svg-icons";

class LayoutOffers extends React.Component {
  render() {
    const dataDoughnutActives = {
      labels: ["Promoters", "Passives", "Detractors"],
      datasets: [
        {
          data: [300, 50, 300],
          backgroundColor: ["#16d2b4", "#ffd701", "#ff8167"],
          hoverBackgroundColor: ["#16d2b4", "#ffd701", "#ff8167"],
        },
      ],
    };
    const dataDoughnutNegatives = {
      labels: ["Offer", "Value", "Product", "Detractors"],
      datasets: [
        {
          data: [300, 50, 250, 50],
          backgroundColor: ["#1d46a0", "#2355c3", "#7493d9", "#afc1e8"],
          hoverBackgroundColor: ["#1d46a0", "#2355c3", "#7493d9", "#afc1e8"],
        },
      ],
    };

    return (
      <div>
        <div className="card-accepted-delivered">
          <Card
            style={{
              display: "block",
              width: "360px",
              backgroundColor: "#2355c3",
            }}
          >
            <h1
              style={{
                fontSize: "36px",
                marginBottom: "10px",
                color: "whitesmoke",
              }}
            >
              DELIVERED
            </h1>
            <div className="numbers-and-icon">
              <p
                style={{
                  fontSize: "18px",
                  marginTop: "10px",
                  color: "whitesmoke",
                }}
              >
                919
              </p>
              <FontAwesomeIcon
                icon={faPaperPlane}
                size="10x"
                style={{
                  color: "#7493d9",
                  paddingLeft: "100px",
                }}
              ></FontAwesomeIcon>
            </div>
          </Card>
          <Card
            style={{
              display: "block",
              width: "360px",
              backgroundColor: "#16d2b4",
            }}
          >
            <h1
              style={{
                fontSize: "36px",
                marginBottom: "10px",
                color: "whitesmoke",
              }}
            >
              ACCEPTED
            </h1>
            <p
              style={{
                fontSize: "18px",
                marginTop: "10px",
                color: "whitesmoke",
              }}
            >
              515
            </p>
            <p
              style={{
                fontSize: "18px",
                marginTop: "10px",
                color: "whitesmoke",
              }}
            >
              52.60%
            </p>
          </Card>
          <Card
            style={{
              display: "block",
              width: "360px",
              backgroundColor: "#ff8167",
            }}
          >
            <h1
              style={{
                fontSize: "36px",
                marginBottom: "10px",
                color: "whitesmoke",
              }}
            >
              DECLINED
            </h1>
            <p
              style={{
                fontSize: "18px",
                marginTop: "10px",
                color: "whitesmoke",
              }}
            >
              24
            </p>
            <p
              style={{
                fontSize: "18px",
                marginTop: "10px",
                color: "whitesmoke",
              }}
            >
              2.45%
            </p>
          </Card>
        </div>
        <div className="charts-from-bottom">
          <div className="chart-from-bottom">
            <Card>
              <CardHeader title="Accepted Reviews Analysis" />
              <div style={{ width: 410 }}>
                <Doughnut
                  data={dataDoughnutActives}
                  options={{
                    rotation: 1 * Math.PI,
                    circumference: 1 * Math.PI,
                    legend: {
                      display: true,
                      position: "bottom",
                    },
                  }}
                />
              </div>
            </Card>
          </div>
          <div className="chart-from-bottomRight">
            <Card>
              <CardHeader title="Declined Reason Analysis" />
              <div style={{ width: 410, height: 205 }}>
                <Doughnut
                  data={dataDoughnutNegatives}
                  options={{
                    rotation: 1 * Math.PI,
                    circumference: 1 * Math.PI,
                    legend: {
                      display: true,
                      position: "bottom",
                    },
                  }}
                />
              </div>
            </Card>
          </div>
        </div>
      </div>
    );
  }
}

export default LayoutOffers;
